import React from 'react'

const Dummy = (props) => {
	const showColor = (e) => {
		console.log(e.target.style.background)
		
	}
	return (
		<div onClick={showColor(e)} className={props.classnames} style={props.styling}></div>
	)
}

export default Dummy
